import React, { useState } from 'react';
import {
  Container,
  Paper,
  Typography,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Button,
  Stack,
  IconButton,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';
import EditIcon from '@mui/icons-material/Edit';
import DepartmentDialog from '../components/DepartmentDialog';

interface Department {
  name: string;
  description: string;
  employeeCount: number;
}

const initialDepartments: Department[] = [
  {
    name: 'Engineering',
    description: 'Software development team',
    employeeCount: 0,
  },
  {
    name: 'Marketing',
    description: 'Marketing and communications team',
    employeeCount: 0,
  },
  {
    name: 'Human Resources',
    description: 'HR management and recruitment',
    employeeCount: 0,
  },
];

const Departments = () => {
  const [departments, setDepartments] = useState<Department[]>(initialDepartments);
  const [dialogOpen, setDialogOpen] = useState(false);
  const [selectedDepartment, setSelectedDepartment] = useState<Department | undefined>();
  const [dialogMode, setDialogMode] = useState<'add' | 'edit'>('add');

  const handleAddClick = () => {
    setSelectedDepartment(undefined);
    setDialogMode('add');
    setDialogOpen(true);
  };

  const handleEditClick = (department: Department) => {
    setSelectedDepartment(department);
    setDialogMode('edit');
    setDialogOpen(true);
  };

  const handleDeleteClick = (departmentToDelete: Department) => {
    setDepartments((prevDepartments) =>
      prevDepartments.filter((dept) => dept.name !== departmentToDelete.name)
    );
  };

  const handleDialogClose = () => {
    setDialogOpen(false);
    setSelectedDepartment(undefined);
  };

  const handleSaveDepartment = (department: Department) => {
    if (dialogMode === 'add') {
      setDepartments((prevDepartments) => [...prevDepartments, { ...department, employeeCount: 0 }]);
    } else {
      setDepartments((prevDepartments) =>
        prevDepartments.map((d) => (d.name === selectedDepartment?.name ? { ...department, employeeCount: d.employeeCount } : d))
      );
    }
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      <Paper sx={{ p: 2 }}>
        <Typography variant="h6" gutterBottom>
          DEPARTMENTS
        </Typography>
        <TableContainer>
          <Table>
            <TableHead>
              <TableRow>
                <TableCell>Dept. Name</TableCell>
                <TableCell>Description</TableCell>
                <TableCell>Employee Count</TableCell>
                <TableCell>Actions</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {departments.map((department, index) => (
                <TableRow key={index}>
                  <TableCell>{department.name}</TableCell>
                  <TableCell>{department.description}</TableCell>
                  <TableCell>{department.employeeCount}</TableCell>
                  <TableCell>
                    <Stack direction="row" spacing={1}>
                      <IconButton
                        size="small"
                        color="primary"
                        onClick={() => handleEditClick(department)}
                      >
                        <EditIcon />
                      </IconButton>
                      <IconButton
                        size="small"
                        color="error"
                        onClick={() => handleDeleteClick(department)}
                      >
                        <DeleteIcon />
                      </IconButton>
                    </Stack>
                  </TableCell>
                </TableRow>
              ))}
            </TableBody>
          </Table>
        </TableContainer>
        <Button
          variant="contained"
          color="primary"
          sx={{ mt: 2 }}
          onClick={handleAddClick}
        >
          Add Department
        </Button>
      </Paper>

      <DepartmentDialog
        open={dialogOpen}
        onClose={handleDialogClose}
        onSave={handleSaveDepartment}
        department={selectedDepartment}
        mode={dialogMode}
      />
    </Container>
  );
};

export default Departments;
